import './App.css';
import AllGroup from './components/AllGroup'

import {Routes, Route} from 'react-router-dom'


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<AllGroup />} />
      </Routes>
    </div>
  );
}

export default App;
